// import{Link} from 'react-router-dom';

const ShopDisplay = (props)=>{
    const listFaishon = ({faishonData}) =>{
        if(faishonData){
            return faishonData.map((item)=>{
                  return(
                    <div class="faishontype">
                        <h2 class="faishon-heading">Western Wear</h2>
                        <img src="https://i.ibb.co/q780s4r/saree2.jpg" alt='Indianwear'>
                        </img>
                        <a>shop now</a>
                    </div>
                )
            })
        }
    }

    return(
        
        <div class="content">
           {listFaishon(props)}
            </div>
            
    )

  
}
export default ShopDisplay;
